import React, {Component} from 'react';
import Group from "./Group";
import Title from '../Title/Title'
import './GroupLessons(back-free).css'
import practiceGroupImg from '../../assets/practic-psyhology-group.jpg'
class GroupLessonsBackFree extends Component {
    render() {
        const groupTitleText = 'Групові заняття';
        const practicGroupText = '  Для всіх, хто цікавиться психологією, психотерапією, особистісним розвитком.\n' +
            'Учасники курсу отримають знання з психології, психотерапії які зможуть застосовувати в житті, в професійній діяльності, стосунках (в особистих і ділових).\n' +
            'В групі буде робота з метафоричними малюнками, засобами арт-терапії, терапевтичними казками,  життєвими сценаріями.';
        const groupTitleStyle = {
            padding: '125px 0 50px 0'
        };
        return (
            <section className="group-lessons-section">
                <div className="group-lessons-container">
                    <Title style={groupTitleStyle} text={groupTitleText}/>
                    <div className="group-lessons__inner">
                        <Group title="group title" image={practiceGroupImg} location="Рівне" time="10:00 - 19:00" date="10/08/2021" text={practicGroupText}/>
                        <Group title="group title" location="Рівне" time="10:00 - 19:00" date="10/08/2021" text="Lorem ipsum dolor sit amet, consectetur adipisicing elit. Atque beatae cupiditate enim est et explicabo id ipsum natus nesciunt, optio perferendis placeat quae quam quidem recusandae, repudiandae tenetur totam unde."/>
                        <Group title="group title" location="Рівне" time="10:00 - 19:00" date="10/08/2021" text="Lorem ipsum dolor sit amet, consectetur adipisicing elit. Atque beatae cupiditate enim est et explicabo id ipsum natus nesciunt, optio perferendis placeat quae quam quidem recusandae, repudiandae tenetur totam unde."/>
                        <Group title="group title" location="Рівне" time="10:00 - 19:00" date="10/08/2021" text="Lorem ipsum dolor sit amet, consectetur adipisicing elit. Atque beatae cupiditate enim est et explicabo id ipsum natus nesciunt, optio perferendis placeat quae quam quidem recusandae, repudiandae tenetur totam unde."/>
                    </div>
                </div>
            </section>
        );
    }
}

export default GroupLessonsBackFree;
